const tasks = [
    {
        id: 1,
        text: 'Doctors appointment',
        day: 'feb 5th at 20:00',
        reminder: 'true'
    },
    {
        id: 2,
        text: 'Meeting at school',
        day: 'feb 6th at 13:30',
        reminder: 'true'
    },
    {
        id: 3,
        text: 'Food shopping',
        day: 'feb 5th at 14:30',
        reminder: 'false'
    }
]

const Tasks = () => {
    return (
        <>
            {tasks.map((task) => (
                <h3>{task.text}</h3>
            ))}  
        </>
    )
}

export default Tasks
